INSERT INTO `conference` VALUES (26,'Chiang Mai SEO Conference 2019','2019-11-14','2019-11-15','https://chiangmaiseoconference.com/','Chiang Mai, Thailand','Diggity Marketing','Matt Diggity',0,'https://chiangmaiseoconference.com/','<h2>Exchange ideas, drive innovation and strengthen results at Southeast Asia&rsquo;s annual gathering of top SEO entrepreneurs.</h2>\n\n<p>Returning for its third year from 14-15 November 2019, Chiang Mai SEO Conference is an annual gathering of over 750 decision makers, agency owners, super affiliates, e-commerce magnates, investors, and influencers.</p>\n\n<p>With two days of presentations led by SEO movers and shakers and a range of networking events hosted at hotspots around Chiang Mai, CMSEO is a must-attend event for those looking to sharpen their digital game.</p>\n\n<div style=\"background:#eeeeee;border:1px solid #cccccc;padding:5px 10px;\"><strong>11-12 November: </strong>Free Workshops and Networking Events</div>\n\n<h2>&nbsp;</h2>\n\n<div style=\"background:#eeeeee;border:1px solid #cccccc;padding:5px 10px;\"><strong>14-15 November:</strong> Chiang Mai SEO Conference 2019</div>\n',1),(28,'World Congress on Otology, Rhinology & Laryngology','2020-03-23','2020-03-25','https://coalesceresearchgroup.com/conferences/otology-rhinology','Crowne Plaza Dubai - Deira,Salah Al Din St, Dubai, United Arab Emirates.','Coalesce Research Group','Jacob Davis',0,'https://coalesceresearchgroup.com/conferences/otology-rhinology','<p>The <strong>World Congress on Otology, Rhinology and Laryngology</strong> (<a href=\"https://coalesceresearchgroup.com/conferences/otology-rhinology\">Otorhinolaryngology 2020</a>) is a highly specialized event organized by the Coalesce Research Group, which plays a vital role in the development of the ENT profession is scheduled to be held on from March 23 - 25, 2020 in Dubai, United Arab Emirates. The format of the Conference with the theme &ldquo;Developing New Strategies for Therapeutic Interventions in Otorhinolaryngology&rdquo; features top-notch &amp; novel presentations of experts during conference allowing attendees to have interactive sessions and to learn latest experiences &amp; best practice.</p>\n\n<p>On behalf of the Otorhinolaryngology 2020 committee, we are pleased to invite Otolaryngologists, Otologists, Audiologists, Speech Therapists, Fellows and Residents, Neurosurgeons and Neurologists, Family Physicians, Physiotherapists and Rehabilitative Personnel to attend/ participate in this elite event.</p>\n',1),(29,'World Nursing and Nursing Education Congress','2020-06-17','2020-06-18','https://worldnursing.peersalleyconferences.com/','Vancouver, Canada','Peers Alley Media','ZoeyAsper',0,'https://worldnursing.peersalleyconferences.com/','<p>Peers Alley Media meetings would like to invite all the outstanding world leading Nursing Practitioners, Clinical Nurse Specialist, Public health practitioners, Clinical researchers, Primary care physicians, Nurses, Physician assistants, Scientists, Deans, Students &amp; Technicians, Medical health care Organizations &amp; Associations, Public Health Professionals, Pathologists, Doctors, Research Scholars from all around the world to attend World Nursing and Nursing Education Congress during <strong>June 17-18, 2020 </strong>in <strong>Vancouver, Canada</strong>.</p>\n\n<p>This conference gives an unparalleled opportunity to network with colleagues and learn from the different leaders in Nursing Practice.</p>\n',1),(30,'TiECon Chandigarh 2020','2020-02-29','2020-02-29','https://www.tieconchd.com/','Indian School of Business, ISB Mohali, Sector 81, India','Davinder Partap Singh','Davinder Partap Singh',0,'https://hub.tie.org/e/tiecon-chandigarh-2020#venue','<p>TiE Chandigarh is organizing the 5th&nbsp;edition of its flagship event TiECon Chandigarh 2020 on&nbsp;<strong>Saturday, 29th&nbsp;February 2020&nbsp;</strong>at&nbsp;<strong>Indian School of Business</strong>, Mohali Campus. This would be the biggest entrepreneurial event in the Northern Region focusing on opportunities and challenges faced by young and emerging entrepreneurs.</p>\n\n<p><strong>TiECon Chandigarh 2020&nbsp;</strong>will feature business leaders from across India and abroad. The day-long power-packed summit will include inspiring talks, exciting discussions, motivating mentoring sessions and an opportunity to network with likeminded passionate entrepreneurs.</p>\n\n<h2><strong>TiECon Chandigarh 2020</strong></h2>\n\n<p>&nbsp;Feb 29, 2020 (09:00 AM - 06:00 PM)&nbsp;? 999 onward</p>\n',1),(31,'World Congress on Neuroscience and Brain Disorders','2020-03-30','2020-03-31','https://coalesceresearchgroup.com/conferences/neuroscience','Osaka, Japan','Coalesce Research Group','jesse olson',17185439362,'https://coalesceresearchgroup.com/conferences/neuroscience','<p>Coalesce Research Group is very delighted to invite you to &ldquo;International Conference on Neuroscience and Brain disorders (Brain disorders 2020)&rdquo; on &lsquo;March 30-31, 2020&rsquo; at &lsquo;Osaka, Japan&rsquo; with the ongoing theme &ldquo;Current Research Trends in Neuroscience and Brain Disorders&quot;.</p>\n',1),(34,'Dual axes, line and column','2020-09-02','2020-09-04','http://docpoke.in/oeno/orders.php','rewrew','wqsw','wrerw',44324234,'https://www.abc.com','<p>dsadsddsads</p>\n',1),(35,'','1970-01-01','1970-01-01','','','','',0,'','',0),(36,'','1970-01-01','1970-01-01','','','','',0,'','',0);
