INSERT INTO `contact` VALUES (1,'Stephen Gagnon','',0,'info@serps.ca','Code Web Canada Corp.','Issues completing my profile','I’m having troubles finishing my profile on your website!\n\nOnce I fill everything in — website won’t allow me to \"Save\"\n\nStephen Gagnon\nCompany Director\n(403) 383-0153\ninfo@serps.ca\nhttps://serps.ca/'),(3,'Colin Dales',' +1',8785515325,'seoleads@Friki.in','friki.in','Exclusive SEO & Web Designing Leads','Hi,\n\nThis is Colin Dales from Friki, we specialize in providing exclusive SEO & Web Designing leads, All the leads we provide are within 24 hours fresh and we have received great feedback from our clients all over the world!\n\nAll the leads we provide are exclusive which means it is not shared with any other company apart from yours! We only us C-Level Data i.e Business owners and Decision Makers. We also have clients who achieve conversion rates of over 10% on our leads.\n\nBased on our customer reviews our leads are simpler to get hold off and easier to convert. We can generate over 50 leads a day, We can also go ahead and share samples with you; Looking forward to your response.\n\nThanks,\nColin Dales\nFriki Leads'),(4,'Shivani Raikwar',' +91',8447921580,'shivani@esearchlogix.com','live:shivani_332','Please delete my blog from your site','Hi,\n\nI am writing this mail on behalf of esearchlogix.com, https://www.top-seos.com/profile/esearch-logix-technologies-pvt.-ltd-245\n\nPlease delete my blog from your site, as it is already live on other site. Please delete it as soon as possible. https://www.top-seos.com/post/how-much-significance-the-app-development-software-has-for-saving-time-and-efforts-35\n\nBy today end i will send a new blog. \n\n\nThanks & Regards,\n\'Shivani Raikwar'),(5,'Jayalakshmi',' +91',8695903140,'jayaseo@gmail.com','91-8695903140','Professional and focused Organic SEO Services from India,','our experience in organic search engine optimization with the power of the social web, we are able to help our clients better understand how their customers think and interact online and then use that information to increase Brand visibility, traffic, and sales and to improve the online reputation of the company on their prospects.'),(14,'Caroline',' +1',4343434343,'caronline7564@gmail.com','caroline.654','Web development','Hello\nHope are you doing well,'),(16,'Dibyendu Chakraborty',' +91',9749666588,'dibyenduguestpostpublisher@gmail.com','dibyenduguestpostpublisher@gmail.com','Link building services!','Hello Admin,\n\nHope this email finds you well. I hope you are fine & fit:)\n\nMyself Dibyendu Chakraborty  and I love blogging. I am connected with the \"Guest Post Publisher\" since 2015.\n\nWe are a group of online media publishers and we have access on various high quality blogs where we can easily publish articles within a week.\n\nFor e.g: Our writers have their successful author profiles on the following blogs:\n\n1.fotolog.com\n2.hiboox.com\n3.wymdomline.org\n4.harcourthealth.com\n5.beverlyhillsmagazine.com\n\n\nLet me know if you are interested to promote links or client website by publishing articles through us.\n\nThanks!'),(17,'Sumit Kumar Roy',' +91',7074982273,'Sumitroutreachers.online@gmail.com','Sumitroutreachers.online@gmail.com','07074982273','Hello Admin,\n\nMy name is sumit and I am a Digital Media Publisher. I provide high quality, relevant and powerful white hat links to help you create the perfect link profile for your business. I can help you do media outreach to land guest posts and backlinks on authority sites.\n\nI offer outsourced blogger outreach service to SEO companies, agencies, consultants, bloggers and site owners.\n\nI have more than 250+ blogs. Here I’m sending some of my high-quality blogs:\n\n1.bloggymoms.com\n2.daiynewshungary.com\n3.meritline.com\n4.fotolog.net\n5.phefrisky.com\n\nPlease let me know if you are interested. I would be happy to discuss regarding my service. Also, I would be happy to make a long term business relationship with you in the future.\n\nI look forward to hearing from you.\n\nBest Regards,\nSumit kumar r.'),(18,'Kuntal Ghosh',' +91',8777212073,'kuntalghosh@pndoutreach.com','kuntallinkbuildingexpert@gmail.com','Blog posting publication Offer!','Hello Admin,\n\nThis is Kuntal, a blogger outreach service provider and high-quality publisher. Currently, I\'m working on \"PND Outreach\". It\'s a high-quality online news publication campaign. We can publish your content/article on many quality sites. We have got access to over 2 thousand high-quality blogs in various niches with high PA and DA along with visitors in huge numbers.\n\nWe have good hands-on Geo-Targeted SEO and SEM promotional activities and have good working experience with USA, UK, AUS, and NZ clients as well as agencies. This is a popular and result-oriented marketing tactic to promote a website through back-links which Google loves. It helps to increase the traffic by driving more visitors to the site and also helps to improve Google page ranking and search results.\n\nIf you\'ve ongoing projects/campaigns which need additional support then we would be much happy to contribute to your effort to boost your endeavor.\n\nLooking forward to a positive response from your side.\n\nMan'),(19,'Hriday Laha',' +1',7074982273,'hridayguestpostpublisher@gmail.com','hridayguestpostpublisher@gmail.com','Our Best part of SEO link building services!!!','Hello there,\n\nI’m A SEO Project Manager and Link Building Expert from “guestpostpublisher.com” Organization. We are providing our service i.e. SEO, SEM, SMM, Link Building, Content Marketing, Guest Post Services and many more. We are specializing in providing results-oriented internet marketing solutions to various businesses. Our interactive marketing services are customized to build your internet presence, increase your leads, increase your website conversion and build a stronger brand for your business at an affordable cost. With a full range of customized marketing solutions, each of our customers is guaranteed a custom marketing campaign, designed specifically for their unique needs. We have great resources of high-quality genuine blogs as more than 5000+ sites with high DA and good PA in various niches.\n\nHere are my top demanded 5 blogs:\n\n1) Freelancewritinggigs.com\n2) Ronaldo7.net\n3) Allwomenstalk.com\n4) Shoutoutuk.org\n5) Affenknecht.com\n\nWe provide unique designs for all of our'),(20,'Sajadi K',' +1',7074982273,'sajadikoutreachers.online@gmail.com','sajadikoutreachers.online@gmail.com','Perform SEO Link Building Outreach for a Super SEO Boost','Hello there,\n\nI have DA 30+, DA 60+ & above sites at an affordable price.If you wish then I can also provide you HQ articles.\n\nSome example from my site list (Price $80/post)\n\nCardomain.com DA 60\nIdeafit.com DA 63\nWideinfo.org DA 50\nEmproticos.org DA 53\nThebaynet.com DA 52\nTravelblog.org DA 65 etc.\n\nI can also provide High Authority sites like- Magpress, Lerablog, Design etc.\nAbove sites are just a few examples, No need to worry about the quality. We always take care of our clients. You can use my resource and I am sure you will get good result within a couple of months. I’ll deliver you the live link within 2-3 days.\n\nIf you are interested then please contact me.\n\nWarm Regards!\nSajadi K.'),(21,'Moyna Garai',' +91',9933418356,'moynagarai@pndoutreach.com','sathiseoexpert@gmail.com','Will promote your sites with high-quality sites!','Hello Admin,\n\nMyself Moyna Garai and I love blogging. I am connected with the \"PND Outreach\" since 2017.\n\nCurrently, I\'m providing High-Quality Guest post services to all of my clients. it\'s also a proven marketing tactic that increases brand awareness and conversions. Link building can help drive other marketing strategies as well. I\'ve sites in various niches like, Finance / Sports / Education / Technology / Health / Hospitality / Real Estates and many more. And all of my sites are minimum DA 25 to 90.\n\nFollowing are the blogs 