INSERT INTO `featured` VALUES (1,'Register & Login','<p><strong>Register NOW</strong>. While Signup you can Select Account Type ( As a Freelancer / Company or Client&nbsp;). Once your Registration&nbsp;part is completed, you will&nbsp;get an email from Top SEOs to activate your account. You just need to click on the link which is mentioned in the email.</p>\n\n<p>After, that you can log in&nbsp;to your account. <a href=\"https://www.top-seos.com/login\" target=\"_blank\">Click Here for Account Login</a></p>\n','5dcb0c81b7f4aimage.png',0,'',1),(2,'Create Your Account Profile','<p>Create your profile on Top-SEOs.com, where you can add your Pictures, Name of the Person, Designation, Address, Hourly Price, Summary About Yourself, Social Links and many more.</p>\n','5dce820aad42bimage.png',1,'',1),(3,'Add Other Information','<p>In this section, you can ADD</p>\n\n<p><strong>Industry &amp; Skills</strong><br />\nUsers can select their Industry as well as Technology in which a user is specialized. If there is no suitable match for your(user) Industry and Skills you can add it additionally. Top-SEOs Team will re-check it and approve it and the user will get the notification for the same.</p>\n\n<p><strong>Packages</strong><br />\nUsers can add their Gigs/service packages in detail to boost their profile.</p>\n\n<p><strong>Portfolios</strong><br />\nUsers can add their respective portfolios so that visitors can see their previous work done.</p>\n\n<p><strong>Testimonials</strong><br />\nUsers can add their testimonials Either Text or via YouTube link. Both ways the user can share their Testimonials with Top-SEOs.</p>\n\n<p><strong>Case Studies</strong><br />\nUsers can add their Case Studies in PDF.</p>\n','5dce8292a1ebeimage.png',1,'',1),(4,'Submit Your Article','<p>Users can do Blog Writing and Posting. User blog content needs to be unique and effective. Top-SEOs Admin can allow the user to add 1 link as a backlink.</p>\n','5dcb145d37ba0image.png',0,'',1),(5,'Submit Conference','<p>Submit &amp; find your events and conferences based on Internet Marketing, Development and many more at Top-SEOs.com. Promote your Events and Conferences on Top-SEOs.</p>\n\n<p>We are the easiest online conference and event listing site. Become a free member and start listing your conference, summit, event, expo, convention within minutes.</p>\n\n<p><em><strong>Submit a Conference Now - For FREE</strong></em>! Conference organizers and meeting planners use this form to submit your conference, convention, trade show, exhibit or workshop for <strong>FREE</strong>! Your conference will be seen by thousands of people interested in attending conferences. <strong><a href=\"https://www.top-seos.com/conference\" target=\"_blank\">POST NOW</a></strong></p>\n','5dcb164657638image.png',1,'Post your Event, Meeting, Conference Today For Free | Submit Conference',1),(6,'Unbiased Ranking','<p>User Ranking will be unbiased, it does not depend upon the Plans or Paid Ads. It&#39;s only and only on the reviews which users get it from their clients for their respective skills or industries specific.</p>\n','5dcb173b92010image.png',0,'',1),(7,'Reviews','<p>Users can invite their Clients to get Feedback / Add Reviews of their previous works. Submission will be verified by Linkedin and later Top-SEOs team will verify it manually. If any fraud caught by the team, the concerned profile will be suspended forever.</p>\n','5dcb1a0b636f4image.png',0,'',1),(8,'Post a Job','<p>You can create a free job posting on Top-SEOs in less than five minutes. Simply create an account, enter your job&rsquo;s details, preview it, and you&rsquo;re ready to start hiring. Free job postings receive standard visibility in relevant search results and fall behind newer jobs over time.</p>\n','5dd3d00741a27image.png',0,'Post Jobs for Free | Start Hiring in Minutes | Hire Employees',1),(9,'Real Time Chat','<p>Visitors can interact with the concerned profile member via text chat and discuss their projects with them. Users have the options for the Group Chat where team members can be added in that group as staff members.</p>\n','5dd3d22f59cfcimage.jpeg',1,'Real Time Chat | Real Time Messaging | Live Chat Service',1),(10,'Job Offer & Hiring','<p>User (Client) can hire Users (Freelancers / Companies) via 2 ways a) Direct Chat and Send Job offer b) Create Jobs on Top-SEOs.com and User (Freelancer/Companies) will bid on that job post. User (Client) will choose the proposal out of it. The chat &amp; Hire process will move further. Above of that User (Client) has to be verified their payment methods only then User (Client) will be able to post the jobs and hire the respective User (Freelancers / Companies)</p>\n','5dd3d3b440259image.jpeg',0,'',1),(11,'Lead Capture','<p>Visitors can fill the respective forms available on the user profile and can set up a meeting or request a quote for their projects. Three Type of&nbsp;Lead Capture Forms That Convert&nbsp;Into Projects:-</p>\n\n<p>1) Request A&nbsp;Quote</p>\n\n<p>2) Schedule A Visit</p>\n\n<p>3) Request A Call</p>\n','5dd3d52f023d1image.png',1,'',1),(12,'Leave Management','<h2><strong>A Guide to Better Leave Management</strong></h2>\n\n<p>Leave management is a tricky concept that companies today use to handle their employees. Therefore, it is of great essence for companies to retain employee satisfaction while maintaining a smooth system that doesn&rsquo;t harm the business.</p>\n\n<p><strong>What is Leave Management? </strong>Simplest, yet, one of the crucial HR activities wherein HR Personnel have to ensure an act of complying with extended leave policies, guarantee the availability of ample staff at all the time, and ensuring the smooth functioning of all operations.</p>\n\n<p>Having an efficient and reliable Leave Management System is crucial to succeeding as an organization as poor leave management can have a negative impact on overall employee performance and company reputation. All this could impact project deliverables, in turn. Today most of the countries are taking adequate steps to ensure employee satisfaction by keeping adequate Leave policies at top of their wish list, which is accompanied by flexible working hours and professional development opportunities.</p>\n\n<p>There are <em>various types of leaves</em> that employees usually avail under different circumstances throughout their work life.</p>\n\n<ul>\n	<li><strong>Holidays </strong>- These leaves are paid leaves and no salary deductions are made here.</li>\n	<li><strong>Earned or Privilege Leaves</strong> - These leaves can be availed by the employees as they work for an organization for a specific number of days.</li>\n	<li><strong>Casual Leave</strong> - These leaves are often granted for short durations and it requires prior informing to the employers.</li>\n	<li><strong>Medical Leave</strong> - If the employee is sick and is not in a state of doing work or comes to the office, he can avail of this type of leave often referred to as Sick Leave.</li>\n	<li><strong>Maternity Leave</strong> - These leaves are especially meant for the woman employees who plan to have a baby. The duration of maternity leave is 12-24 weeks.</li>\n	<li><strong>Study Leave</strong> - An employee can be granted study leave to enable her to update the skills and knowledge in a way that can benefit the organization as a whole.</li>\n</ul>\n\n<h3><strong>Importance of Leave Management in an organization</strong></h3>\n\n<p>Various processes in which leaves and absence due to vacation, sickness, and other reasons are taken care of by the company personnel, especially an HR, is called Leave Management. So, leave management is important because:</p>\n\n<ul>\n	<li>Inconsistent leaves and leave policies can cause huge costs to the company.</li>\n	<li>Employees need to plan their long vacations or leave well in advance.</li>\n	<li>Reality-check is given to the employees based on their attendance by their leave account.</li>\n	<li>Unplanned leaves can lead to skipping targets and deadlines.</li>\n</ul>\n\n<p>The responsibility of handling employee leaves falls on the shoulders of HR staff, supervisors, and workforce staff.</p>\n\n<h3><strong>Key Features and Benefits of Leave Management System</strong></h3>\n\n<p>While some companies don&rsquo;t take Leave management seriously, recent researches have shown that bad or poor management of leave policies can reduce employee morale negatively, impact project deadlines, and thus, can produce a negative impact on overall business operations.</p>\n\n<p>Thus, there is a great deal of the strategic value of Leave management system which comes with the following key functionalities as well as benefits to an organization:</p>\n\n<ul>\n	<li>The leave policies are simple, lucid, and easy to use and manage.</li>\n	<li>Manual work is eliminated too much extent.</li>\n	<li>With efficient leave policies, you win as a manager and succeed as a team.</li>\n	<li>Automated leave policies help to maintain accuracy and transparency.</li>\n	<li>The information is highly precise and accurate.</li>\n	<li>Leaves that are strictly designed to comply with a company&#39;s policies involve discipline.</li>\n	<li>There is an aura of consistency from day one of its use.</li>\n	<li>There is a positive impact on ROI through high operational efficiency.</li>\n</ul>\n\n<p>And most importantly, an Efficient leave management system increases employee satisfaction and engagement. Hence, the Leave management system is essential for the smooth functioning of an organization as a whole.</p>\n\n<p><strong>In a nutshell, Leave Management also called time-off management </strong>controls the set of applications, approvals/rejections, and tracking of employee leaves in the organization. <em>&ldquo;An employee&rsquo;s motivation and performance are direct results of how satisfied he is with the company&rsquo;s work culture, managerial behavior, and most importantly, effective management policies where their interests are taken care of while ensuring a seamless functioning of an organization.&rdquo;</em></p>\n','5dd4f333dbc21image.png',1,'HR Leave Tracking System | Employee Leave Management | Time-Off Management',1),(13,'Project Management','<h2><strong>Manage your Projects using our All-in-one Project Management System</strong></h2>\n\n<p><em>&ldquo;Why is project management software so important to an organization&rdquo;,</em> is an interesting question that generally comes in everyone&rsquo;s mind. They wonder if there&#39;s really a need for a project management system because on paper it looks like unnecessary overhead as project managers don&rsquo;t really deliver anything...</p>\n\n<p>All this is a false economy. Running projects without good project management is a myth. Without it, what could hold the team and client together? And, without it, who is deemed to go through ups and downs, clashes, and catastrophes of the project?</p>\n\n<p>So, to speak explicitly, a Project management system is a total aggregation of the tools and techniques along with the procedures, processes, and methodologies that are used for the purpose of <em>planning, organizing, and managing the tasks and resources</em> to accomplish a defined objective, usually with constraints on time and cost.</p>\n\n<h3><strong>Project management answers the following questions:</strong></h3>\n\n<ul>\n	<li>What is to be done?</li>\n	<li>When must it be done?</li>\n	<li>How much will it cost?</li>\n	<li>Who will complete the task?</li>\n	<li>How are the projects progressing?</li>\n	<li>What happens if work isn&rsquo;t completed on time?</li>\n	<li>What are the next steps?</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h2><strong>Key Benefits of Project Management Software</strong></h2>\n\n<p>Project management software can be easily customized and tweaked regardless of the size of the team and the business. They come flooded with a number of key benefits and advantages that can be exploited to the full.</p>\n\n<p>Once you will understand all the advantages of project management software, you will never go back.</p>\n\n<ul>\n	<li><strong>Everything under the same hood: </strong>It provides a centralized platform to keep a clear channel of assigned tasks, communication, and attachments all in the same place.</li>\n	<li><strong>Setting clear goals and objectives:</strong> This is an essential step project management software ensures for identifying the destination and providing a roadmap for getting there.</li>\n	<li><strong>Provides Bird&rsquo;s eye view: </strong>Project management software helps to gain valuable insights on the workflow of teammates, bottlenecks in development, and team progress as a whole.</li>\n	<li><strong>Effective team collaboration:</strong> Using a project management system, it&#39;s easy to ask for status updates, catch meetings, get your message across and ensure everyone is united.</li>\n	<li><strong>Improved Productivity:</strong> It improves your work and team communication thus, allowing you to quickly scope and prioritize work so as to increase accuracy and on-time delivery.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h2><strong>Choosing the Right Project Management System</strong></h2>\n\n<p>As a project manager, you can&rsquo;t afford to make a mistake when choosing the best project management system as you need to prepare project plans, define the scope, and schedule wisely.</p>\n\n<p>So, it&#39;s important to select a project management system with all the below-listed features to make project management effective.</p>\n\n<ol>\n	<li><strong>Resource management:</strong> It is an integral part of every project as it will make aware of the whole project cost and other related things.</li>\n	<li><strong>Risk management: </strong>A risk is an uncertain condition that might affect your project. So, your system should be able to identify and manage risks in the project plan and thus, calculate all risks in advance.</li>\n	<li><strong>Ease of use:</strong> A good project management system should have a minimalistic design with a simple drag-and-drop interface, easy functionality, smooth maintenance, and support.</li>\n	<li><strong>Third-party Integration:</strong> As a project manager, you should look for a project management system that supports integration to many popular apps including Google Drive, Dropbox, FreshBooks, and many more.</li>\n	<li><strong>Effective time tracking:</strong> Today most of the project managers find time tracking as a quintessential feature for better planning, accurate time estimation, &amp; working with great precision on project tasks.</li>\n	<li><strong>Customizable workflows:</strong> Using custom workflows in project management, it becomes easy to know who is working on what and which stage of the workflow it&rsquo;s in for easy monitoring.</li>\n	<li><strong>Native mobile app: </strong>Mostly, Project managers are often on the go or in meetings. Project management mobile apps are a comfortable way to keep track of tasks, milestones, and deadlines.</li>\n	<li><strong>Easy collaboration:</strong> The system should keep conversations with teammates, clients, and vendors in one place, and keep everyone on the same page.</li>\n</ol>\n\n<h3><strong>The Bottom Line</strong></h3>\n\n<p>Without the Project management system, teams and clients are exposed to poor management, lack of resources, unclear goals and objects, unrealistic planning, high risks, and project deliverables of low quality. Thus, Great Project management matters as great management with great training drives success in the long-term.</p>\n\n<p>At present, various project management systems are available that you can use to manage your projects. It&rsquo;s up to your business and team size whether you are choosing the software <strong>that can help you get your projects back under control.</strong></p>\n','5dd4f79705537image.png',0,'Project Management System | Plan & Manage Your Projects',1),(14,'Task Management','<h2><strong>What is Task Management?</strong></h2>\n\n<p><strong>Project management</strong> commences with segregating your projects into manageable partitions which consist of smaller tasks and subtasks at the lower levels. Managing such tasks, while keeping up the cost and schedule, constitutes the essence of task management.</p>\n\n<p><em>So, what is Task management all about?<strong> </strong></em>It is essentially the process by which a project&#39;s tasks are monitored through various stages namely - Design, Review, Closed, from start to finish. The tasks are monitored and managed based on their priority with an end goal being the successful completion of the tasks.</p>\n\n<h3><strong>Managing Tasks</strong></h3>\n\n<p>The most important aspect of managing the tasks is its prioritization, whether you pick a simple to-do list to manage tasks or a comprehensive task management tool. For the successful completion of any project, there is a strong need to:</p>\n\n<ul>\n	<li>establish clear goals, and,</li>\n	<li>work on a priority basis.</li>\n</ul>\n\n<p>Another way to manage tasks can be by categorizing tasks based on their &ldquo;urgency&rdquo; and &ldquo;importance&rdquo;. With this sort of structure, important works that need to be done immediately should be kept top in the priority list whereas less important works that are non-urgent in nature can be placed low in the schedule.</p>\n\n<h3><strong>Importance of Task Management</strong></h3>\n\n<p>In essence, Task management ensures projects stay on the track as well as get completed on time. It improves the overall workflow in many ways:</p>\n\n<ul>\n	<li>Helps to establish clear goals and deadlines for task completion.</li>\n	<li>Prioritizes the tasks while keeping up with cost and schedule.</li>\n	<li>Enables us to differentiate between Urgent/Non-Urgent tasks as well as tasks that are Most important/Least important.</li>\n	<li>Ensures us to make effective use of the art of delegation.</li>\n	<li>Brings discipline and focus to the job in hand.</li>\n	<li>Helps to manage the work more efficiently and effectively.</li>\n</ul>\n\n<h3><strong>Ways to implement Task Management in any organization</strong></h3>\n\n<p>The task management system comes with various tools and techniques that can be exploited for effective monitoring of the tasks and sub-tasks.</p>\n\n<p><em>Tools in hand - </em>You can manage tasks with various tools, such as:</p>\n\n<ul>\n	<li>Checklists or simple to-do lists</li>\n	<li>Calendars</li>\n	<li>Kanban Boards</li>\n	<li>Cloud or on-premise software</li>\n</ul>\n\n<p><em>Beyond the tools - </em>There are various techniques that you can use, such as:</p>\n\n<ul>\n	<li>Learn and practice to say &ldquo;No&rdquo; wherever required</li>\n	<li>Beware of Killers (Time or Productivity)</li>\n	<li>Use the art of Delegation</li>\n	<li>Remember to set aside time for routine tasks</li>\n	<li>Never Procrastinate</li>\n</ul>\n\n<h3><strong>Who is Task Management For?</strong></h3>\n\n<p>Task management is for everyone who wants to get benefit from it. People who make use of task management fall into the following broad categories:</p>\n\n<ul>\n	<li>Project Leaders</li>\n	<li>Teams</li>\n	<li>Personal task management</li>\n</ul>\n\n<h3><strong>Key Features of Task Management Software</strong></h3>\n\n<p>Task management software aids you spend less time managing tasks and more time completing them. The software comes with a number of quintessential features and key characteristics that help in effectively tracking milestones, set dependencies, and accomplish tasks.</p>\n\n<ul>\n	<li>Provides a centralized place to manage tasks</li>\n	<li>Categories milestones</li>\n	<li>View tasks in several styles</li>\n	<li>Split the large task into a number of subtasks</li>\n	<li>Instant view of task reports, and so on.</li>\n</ul>\n\n<p><strong>In a nutshell, </strong>Task management is a complicated discipline that, though can appear simple and easy, requires a great deal of attention to detail, right tools, and flexibility.&nbsp;</p>\n','5dd4f9ea38f95image.png',1,'Task Management For Teams | Work Task Management',1),(15,'Expense Management','<p><em>Expense management for Information Technology is complex, and at times impossible</em>.</p>\n\n<p>Manage your company&#39;s&nbsp;expense management&nbsp;process with a web-based expense solution.</p>\n\n<p><strong>Expense Management</strong> is the system to organize, maintain, record, and analyze expense information for successfully managing a range of financial transactions.</p>\n\n<p><strong>Top SEOs </strong>eliminate dependence on vendor platforms by centralizing all monthly billing and providing reporting with dashboards, analytics and raw data reports that are built to ensure you know exactly where each and every penny is spent. In one convenient platform.</p>\n\n<p><strong>Reduce costs by 30-50%</strong> instantly by simply having all the facts!</p>\n\n<p>Focused on areas that are traditionally challenging to manage.&nbsp; Quickly identify spikes in spending.&nbsp;Take the guesswork out of exactly how much money is being spent a month over month and year over year.&nbsp;</p>\n\n<ul>\n	<li>\n	<p>Detailed insight for budget planning and management</p>\n	</li>\n	<li>\n	<p>A month or over month/year over year comparisons</p>\n	</li>\n	<li>\n	<p>The average cost per asset/ Line increase/decreases, spending trends</p>\n	</li>\n	<li>\n	<p>Yearly tracking of usage (I.e.: roaming, data usage, long-distance, etc.)</p>\n	</li>\n	<li>\n	<p>Organization reporting (reporting based on companies org. chart structure)</p>\n	</li>\n</ul>\n\n<p>Want to know exactly which area of the business is driving costs? Or maybe which departments cost reduction efforts are having the most impact?</p>\n\n<p><strong>If cost control is important to your company, having instant insight into each area of your business&#39;s spend is paramount.&nbsp;</strong></p>\n','5dd4fc1350f4cimage.png',1,'Simple Expense Management | Easily Manage Your Expenses',1),(16,'Create and Manage Invoice','<p>Create&nbsp;and send professional looking PDF&nbsp;invoices&nbsp;with our online system. Send professional&nbsp;invoices&nbsp;in minutes.</p>\n\n<p>The online&nbsp;invoice&nbsp;maker easily creates&nbsp;invoices&nbsp;that you can download, print or send online.</p>\n\n<h3><strong>THE&nbsp;KEY&nbsp;ELEMENTS OF&nbsp;INVOICE</strong></h3>\n\n<ul>\n	<li><strong>A business logo</strong>&nbsp;that makes you look like a professional</li>\n	<li><strong>Your company name</strong>&mdash;usually in a larger font&mdash;at the top of the invoice</li>\n	<li><strong>Your contact information</strong>, so clients know how to get hold of you</li>\n	<li><strong>The client&rsquo;s billing address</strong>&mdash;both the name and the billing details. Take note that in some companies, the client you&rsquo;re working with is not the person to whom you send the invoice</li>\n	<li><strong>Date of issue</strong>&nbsp;or invoice date</li>\n	<li><strong>Payment terms</strong>, so that clients know how many days after the issue date they should pay the invoice. While you may have specific payment terms for your business, larger companies often have their own they strictly adhere to. Make sure your invoice reflects what you&rsquo;ve agreed upon</li>\n	<li><strong>A due date</strong>&nbsp;that makes it clear when you expect to be paid. This is merely the date of issue plus your payment terms</li>\n	<li><strong>Invoice number</strong>&nbsp;to help you track your invoices and stay organized for tax season. You&rsquo;ll want to create sequential invoice numbers to keep things well-ordered</li>\n	<li><strong>Service description</strong>, so clients know what they&rsquo;re paying for</li>\n	<li><strong>The hourly or flat rate</strong>&nbsp;that you usually determine in the early project stages when creating a project estimate</li>\n	<li><strong>Tax amount</strong>&nbsp;that may or may not be applicable</li>\n	<li><strong>The line total</strong>&nbsp;for each service you&rsquo;re providing</li>\n	<li><strong>Any discounts</strong>&nbsp;you may want to apply for specific clients and services</li>\n	<li><strong>The amount due</strong>, so that the client knows what to pay</li>\n</ul>\n','5e0f7872dbb78image.png',1,'Manage Your Invoices | Create A Professional Invoices Instantly',1),(17,'Daily Status Report','<p><strong>Daily Status Reports</strong> are an effective tool to disseminate information in your team. Find our daily status report template to keep track of employee accomplishments and progress projects.&nbsp;Easy, custom, professional <strong>Daily Status Report</strong>.</p>\n\n<p>A Daily Status report&nbsp;is a quick and effective way to make sure everyone in your organization is on the same page.</p>\n\n<p>Daily Reports&nbsp;keep you on track during project execution.</p>\n','5de65269e24c4image.png',0,'Time Tracking Software | Employee Monitoring | Daily Status Reporting Tool',1),(18,'Profit and Loss Report','<p>Measures your organization&#39;s net&nbsp;profit&nbsp;based on total&nbsp;income, salaries, and expenses.</p>\n\n<p>The goal of a Profit &amp; Loss report is to measure the profits by excluding the expenses from the income and provide an overview of the financial health of the business.</p>\n\n<p>The profit and loss statements contain summarized information about revenue and expenses. Based on the standard operating procedure of a business, these statements are generated on a weekly, monthly, quarterly or annual basis.</p>\n\n<p>The basic formula of a Profit and Loss report is:</p>\n\n<p><strong>Revenue &ndash; Expenses = Profits</strong></p>\n','5df7685294541image.jpeg',0,'Company ROI - Return Of Investment | Profile Loss Reports',1),(19,'Recruitment','<p>Recruitment is the first step in building an organization&#39;s human capital. At a high level, the goals are to locate and hire the best candidates, on time, and on budget.</p>\n\n<p><strong>Recruitment</strong>&nbsp;is a process of identifying, screening, shortlisting and hiring potential resource for filling up the vacant positions in an organization. It is a core function of&nbsp;<strong>Human Resource Management</strong>.&nbsp;<strong>Recruitment</strong>&nbsp;is the process of choosing the right person for the right position and at the right time.</p>\n\n<h3><strong>Steps of the Hiring Process</strong></h3>\n\n<ul>\n	<li>Identify the hiring need</li>\n	<li>Devise A Recruitment Plan</li>\n	<li>Write a job description</li>\n	<li>Advertise the Position</li>\n	<li>Recruit the Position</li>\n	<li>Review Applications</li>\n	<li>Phone Interview/Initial Screening</li>\n	<li>Interviews</li>\n	<li>Applicant Assessment</li>\n	<li>Background Check</li>\n	<li>Decision</li>\n	<li>Reference Check</li>\n	<li>Job offer</li>\n	<li>Hiring</li>\n	<li>Onboarding</li>\n</ul>\n','5e0f74c4665b6image.png',0,'Recruitment Process | Job Opportunities | Candidate Details | Interview Feedback',1);
