INSERT INTO `lead` VALUES (2,97,'Nnanna Obuba','0000000000','','oo@oo.com','https://www.bluesodium.com/getdashboard/','Google and Facebook Ad Specialist needed','I am looking for a specialist to help place and test some Google and Facebook Ads. I also need this person to evaluate our landing page and make suggestions for improvement.','',36,'iti__us','United States: +1',2,'America/Winnipeg-06:00',0),(3,97,'Sinean','0000000000','','oo@o.com','http://example.com','Digital Marketing','-Create, manage, and optimize Google Search, Display, and Shopping campaigns\n-Search Engine Optimization\n-Search Engine Marketing\n-Back-link creation\n-AdWords Management\n-Facebook and Instagram Ads manager\n-Social Media Marketing\n-Off-site and on-site website optimization\n-Individual will work with internal team and must have transparency, honesty, and open communication\n-Individual must provide periodic reports that show results and progress','',36,'iti__us','United States: +1',2,'America/Atikokan-05:00',0),(4,97,'Antonis','0000000000','','oo@o.com','http://example.com','Google and Facebook PPC Experts','We are looking for an experienced Google Ads and FB / IG PPC freelancer who can join our team.\n\nThe freelancer will be working together closely with our PPC managers and will be responsible for managing various of the campaigns/accounts assigned to them.\n\nThere will be weekly tasks assigned, and we will be requesting a weekly report sent to us for each of the accounts managed.','',36,'iti__us','United States: +1',2,'Europe/Dublin+00:00',0),(5,97,'Christian','0000000000','skype123','oo@o.com','http://example.com','SEMrush Ranking expert','To be considered for this job you must provide a list/ plan of the specific tasks that you are offering to complete.\n\nThe job will have a duration of 6 months and will pay 100 dollars per month. Total of 600 dollars that will be paid in milestones, one per month.\n\nAbout the website:\n\nThe blog is about personal development and spirituality and has 140 articles with ads. We are targeting only Tier 1 countries. We have big social media accounts on Facebook and Instagram. We are also present on Pinterest and TikTok.\n\nWe have several documents/ ebooks available that we have produced available.\n\nPrimarily we are doing email affiliate marketing (lead gen) and we have a list of subscribers that we email daily.\n\nPS. Your work will be checked and monitored by a senior developer. Any black hat or poor quality techniques will be picked up and lead to the contract being terminated','',36,'iti__us','United States: +1',1,'America/Noronha-02:00',0),(6,97,'Paul walker','0987654123','','','','Need WordPress developer','Need a WordPress developer for ongoing work','Merry-Christmas.jpg',36,'iti__us','United States: +1',2,'America/Adak-10:00',0),(7,97,'Robert','64760889600','vin.mahaj','vin@gm.com','http://www.vinod.com','SEO HELP NEEDED','SEO Testing','1WayIT Meta (2).docx',36,'iti__ca','Canada: +1',1,'Africa/Banjul+00:00',0);
