INSERT INTO `testimonial` VALUES (4,'Zac Carman','CEO ConsumerAffairs','\"With Top SEOs, we are able to find talented developers in a matter of weeks instead of months. The quality of talent they supply is extremely high as the developers are able to immediately onboard and ramp incredibly fast.\"','test-img1.png',1),(6,'Ryan Walker','Director of Product Rand McNally','\"We\'ve been very pleased with our experience working with Top SEOs. Their team was incredibly helpful in helping us find the perfect developer for our project. The work was stellar, the communication was excellent and we couldn\'t have been happier with the overall experience. We\'re excited to work with Top SEOs for more projects in the future!\"','test-img1.png',1),(7,'Elizabeth March','Copywriter','\"I honestly do not know where I would be if I hadn\'t discovered Top SEOs when I did. It has formed the backbone of support for me over recent years.\"','test-img1.png',1),(8,'Jessie Weatherley','Marketing Expert','\"The best thing Top SEOs offers is the independence to work. I can work in any place around the world, even on a boat in the middle of the sea.\"','test-img1.png',1);
/*!40000 ALTER TABLE `testimonial` ENABLE KEYS */;
