l.com/','2020-03-02 12:50:03',0),(21,97,0,'SEO and SMM','<p>Capture the email leads and I will be analyzing conversion tracking and optimization, tweak &amp; manage ads settings for better results, monitor the results( will provide you reports on daily/weekly/monthly basis), tweak the current landing pages to get you business gain max ROI, quality leads and real visitors/Traffic.</p>\n','5e667dfc5a0f3portfolio.png','https://www.therecoveryvillage.com/','2020-03-09 17:30:35',0),(22,298,0,'APA News Agency ','<p>Apanews is an aggregation of all its news sites<br />\npowered in real-time by a network of correspondents.<br />\nBased in each African country and in each of the<br />\nlargest capitals of Europe, Asia or the Americas.</p>\n','','https://play.google.com/store/apps/details?id=com.apanews.apanews','2020-04-22 12:14:44',0),(23,298,0,'Abkasa','<p>The brand offers designer shirts, trousers,<br />\nblazers, suits and accessories under ready to wear,<br />\nmade to measure and bespoke.</p>\n','','https://www.abkasa.com/','2020-04-22 12:17:02',0),(24,365,0,'test titleeess','<p>testerr</p>\n','5f3bc8df4a80aportfolio.jpeg','www.top-seos.com','2020-08-18 11:07:39',0),(27,365,0,'test titleeess','','5f3bc8df4a80aportfolio.jpeg','www.top-seos.com','2020-08-18 12:29:07',0),(28,365,0,'fgjhfgk','<p>fghxfgj</p>\n','5f3bc9e9ced65portfolio.jpeg','http://staging.top-seos.com/p','2020-08-18 12:30:38',0),(29,372,0,'Meta tags','<p>dfzhdjfjgjkfuk</p>\n','5f3e6756b66a1portfolio.jpeg','http://staging.top-seos.com/casestudy/amazaa-368','2020-08-20 12:06:18',0),(30,372,0,'ghttjhd','<p>dtsrdh</p>\n','5f3e6a4e0b63aportfolio.jpeg','http://staging.top-seos.com/','2020-08-20 12:19:29',0);
