INSERT INTO `user_service_brief` VALUES (1,135,3,'<p>I can give best in Local SEO. I have good experinec in Gooogle AU, Google Canada, Google UK and Google US</p>\n'),(2,135,4,'<p>I know how to get best ethical back links and see difference in Rankings.&nbsp;</p>\n\n<p>I use latest link building techniques.</p>\n'),(3,135,59,'<p>I am good in Shopify Plat form and can high rankings in Google to any Shopify wesite.</p>\n'),(4,184,32,'<p><strong>WEB DESIGN &amp; DEVELOPMENT</strong><br />\nIt all starts here. You first need a top-notch website that is accessible everywhere and acts as your online brochure and top-performing salesman.</p>\n\n<ul>\n	<li>Web &amp; mobile solutions</li>\n	<li>E-commerce solutions</li>\n	<li>Applications (aps)</li>\n	<li>Content management systems (CMS)</li>\n</ul>\n\n<p><strong>DIGITAL MARKETING (INBOUND)</strong><br />\nMarketing today is about attracting customers to you by delivering value. It&#39;s a long-term strategy but one that will provide great results for years to come.</p>\n\n<ul>\n	<li>Search Engine Optimisation (SEO)</li>\n	<li>Marketing automation and CRM</li>\n	<li>Email Marketing, Content Marketing</li>\n	<li>Social Media, Blogging, HubSpot etc.</li>\n</ul>\n\n<p><strong>PPC ADVERTISING</strong><br />\nSometimes we can&#39;t wait for long-term strategies to take effect and we need traffic now. That is when you pay the likes of Google, Facebook, LinkedIn, Twitter etc. to get eyeballs and cli'),(5,185,3,'<p>Have over&nbsp;10 years&nbsp; experience with help local business building websites and optimizing them for Google.</p>\n'),(6,97,6,'<p>I am an Amazon SEO Specialist with over 3+ years of experience. I have been working on Paid marketing since last 3 yrs and hence also have experience with Amazon platform.</p>\n\n<p>I have been working on Amazon or 3 yrs an have experience with the following:</p>\n\n<p>Sponsored Ads<br />\nHeadline Search Ads<br />\nProduct Display Ads<br />\nProduct Listing Optimization<br />\nGenerating reports</p>\n\n<p>I have been working on a number of Amazon accounts with $40k/month budgets and have helped them lower their ACoS by -120%.<br />\nThe lowest ACoS that I have achieved is 0.53%.<br />\nI can show you the live projects that I have been working on once we connect.</p>\n\n<p>following methods are developed to help optimize your Amazon product site:</p>\n\n<p>- Optimizing amazon titles<br />\n- Arranging keywords based on logic, meaning high volume terms first, long-tail searches near<br />\nthe end<br />\n- Not using the keywords in the keyword fields<br />\n- Staying as descriptive and detailed as possi'),(7,97,5,'<p>I have helped many small businesses from the US, Canada, and Australia in maximizing their ROI on any given budgets. Most of the clients I worked in the past are Ecommerce based so my.<br />\n<br />\nI expertise in performing organic SEO which includes On-page, Off-page and social media optimization to increase relevant and quality backlinks for the website and more. In order to improve rank in the search engines, I will be doing Article Marketing, Press release distribution, blog promotion, etc. which will help in making the site at the top page of Google and all other major search engines.</p>\n\n<p>My services include:</p>\n\n<p>1) Strategy<br />\n2) Onsite optimization<br />\n3) Offsite optimization<br />\n4) Social Media optimization --- which will include complete Internet Marketing Services suiting your requirements and preferences as I possess hands on expertise at social media campaigns. Here is the list of Social Media sites I can target- YouTube, Facebook, Twitter, Google+, Digg,<'),(8,97,3,'<p>I will work on our proven local SEO Strategies for your website. The main thing for us is to make sure that we use keywords that are locally relevant and have higher usage statistics and compose content in a tone that the locals can easily understand and relate to. We need to make sure that basic on-page elements, such as title, description, headers, images and anchor texts, contain locally relevant content. Google considers the TLD, IP address and onsite content of the websites linking back to your website. Our backlinking strategy would also be focused on creating backlinks from UK sites.<br />\n<br />\nI will create &amp; implement an effective Link Building strategy that will drive a steady stream of targeted traffic to your Website. I&#39;ll be doing</p>\n\n<p>Create links in Blogs<br />\nBlog Optimization<br />\nDirectory submission with LINK ON ANCHOR TEXT<br />\nPress Releases, Article marketing high PR sites.<br />\nSocial Bookmarking in quality sites high PR sites.<br />\nBlogging,'),(9,97,11,'<p><strong>Below activities involved in Campaign Maintenance:&nbsp; </strong></p>\n\n<p>Campaign optimization involves optimization of entire campaign structure, which includes continuously, improving the relevancy of products, priority, benchmark CTR and CPC for A/B testing etc. In addition we will do the following:</p>\n\n<ul>\n	<li>Bids Management</li>\n	<li>Age Level Optimization</li>\n	<li>New Ad-group creation for A/B testing</li>\n	<li>New Campaign Plan creation on the basis of Analysis</li>\n	<li>Budget Optimization on Converting Ones</li>\n</ul>\n'),(10,212,105,'<p>demo</p>\n'),(11,298,36,'<p>Designoweb Technologies&nbsp;is an&nbsp;ISO 9001:2015 Certified&nbsp;company leading the technology development market since last 5 years. Our 6 Sigma based process ensures development of a scalable technology solution for your business.</p>\n'),(12,298,14,''),(13,365,6,'<p>test</p>\n'),(14,365,4,'<p>test</p>\n'),(15,375,7,'<p>tuytyutyuttutyuy</p>\n'),(16,375,4,'<p><em><strong>jljnknlkjnkjnknknknkj</strong></em></p>\n'),(17,379,13,'<p><s><em>This is a test FB advertising</em></s></p>\n'),(18,379,21,'<p><strong>This is a test Instagram advertising</strong></p>\n');
