INSERT INTO `vacancy` VALUES (1,97,16,'Sr.PHP Developer',5,'Sr.PHP Developer','development','3',8,'IT','Mohali','<ul>\n	<li>Knowledge of object oriented PHP programming.</li>\n	<li>Understanding of MVC design patterns.</li>\n	<li>Must be proficient in HTML/CSS and responsive.</li>\n	<li>Expertise in PHP /My SQL.</li>\n	<li>Familiarity with limitations of PHP as a platform and its workarounds.</li>\n	<li>Strong knowledge of the common PHP or web server exploits and their solutions.</li>\n	<li>Customizing and maintaining existing sites.</li>\n	<li>Understanding the fully synchronous behavior of PHP.</li>\n	<li>Candidate should have Creative thinking.</li>\n	<li>User authentication and authorization between multiple systems, servers, and environments.</li>\n	<li>Integration of multiple data sources and databases into one system.</li>\n	<li>Working with Word Press themes and its customization as per clients need.</li>\n	<li>Creating database schemas that represent and support business processes.</li>\n</ul>\n\n<p>Proficient understanding of code versioning tools, such as Git.</p>\n','60000',1,'2020-12-22'),(2,97,15,'Web Designer',2,'Web Designer','designing','3',5,'IT','Mohali','<ul>\n	<li>Should have proficiency in HTML, CSS and JavaScript for rapid prototyping.</li>\n	<li>Proven work experience as a web designer.</li>\n	<li>Proficiency in Photoshop, Illustrator or other visual design and wire-framing tools.</li>\n	<li>Proficiency in HTML, CSS and JavaScript for rapid prototyping.</li>\n	<li>Solid experience in creating wireframes, storyboards, user flows, process flows and site maps.</li>\n	<li>Present and defend designs and key deliverables to peers and executive level stakeholders.</li>\n	<li>Execute all visual design stages from concept to final hand-off to engineering.</li>\n	<li>Conceptualize original website design ideas that bring simplicity and user friendliness to complex roadblocks.</li>\n	<li>Demonstrable graphic design skills with a strong portfolio.</li>\n	<li>Create wireframes, storyboards, user flows, process flows and site maps to communicate interaction and design ideas.</li>\n	<li>Establish and promote design guidelines, best practices and standards.</li>\n	<li>Experience working in an Agile/Scrum development process.</li>\n	<li>Ability to solve problems creatively and effectively.</li>\n	<li>Up-to-date with the latest Web trends, techniques and technologies.</li>\n	<li>Excellent visual design skills with sensitivity to user-system interaction.</li>\n	<li>BS/MS in Human-Computer Interaction, Interaction Design or a Visual Arts subject.</li>\n</ul>\n','40000',1,'2020-12-22'),(3,97,18,'PPC Executive',2,'PPC Executive','Digital Marketing','2',4,'IT','Mohali','<ul>\n	<li>Running PPC campaigns.</li>\n	<li>Should have knowledge about Keyword Discovery, Ad Text Creation and Selection.</li>\n	<li>Should know about Conversion Tracking, Call Tracking and Ad Submission.</li>\n	<li>Have a good hand in PPC Cost Management and PPC Monitoring.</li>\n	<li>Campaign Improvement Modification and Competitive Research.</li>\n	<li>Excellent verbal and written communication skills.</li>\n	<li>Proficient knowledge of Facebook Pixel Setup, including Events and Custom Conversions</li>\n	<li>Should know how to do Custom/Lookalike Audiences Research, Build and Audit Existing Campaigns.</li>\n	<li>Should have knowledge to Retargeting Audiences and Ads.</li>\n	<li>Should have knowledge about Initial Campaign Setup, Ad Copyright and Split Testing.</li>\n	<li>Proficient in Conversion Optimization.</li>\n</ul>\n','250000',1,'2020-12-22'),(4,97,16,'Project Manager',2,'Project Manager','Team Management','5',10,'IT','Mohali','<ol>\n	<li>Create &amp; manage project plans.</li>\n	<li>Define project schedules, allocate resources, and monitor progress.</li>\n	<li>Align project objectives with company goals, and make sure the project team is clear on objectives.</li>\n	<li>Deliver and install technology solutions.</li>\n	<li>Help the project team with the design and development tasks.</li>\n	<li>Lead process of issue identification and resolution.</li>\n	<li>Manage risk tracking process.</li>\n	<li>Monitor and manage scope.</li>\n	<li>Manage all documentation.</li>\n	<li>Work on multiple projects simultaneously.</li>\n</ol>\n','800000',1,'2020-12-22'),(5,97,44,'QA',2,'QA Tester','Testing','2',5,'IT','Mohali','<ol>\n	<li>Proven experience as a Quality Analyst or similar role.</li>\n	<li>Experience in project management and QA methodology.</li>\n	<li>Familiarity with Agile frameworks, database testing, and knowledge of automation tools is a plus.</li>\n	<li>Ability to document and find troubleshoot errors.</li>\n	<li>Working knowledge of any bug reporting tool like- Bugzilla, Zira, mantis, etc.</li>\n	<li>Excellent communication skills for client handling.</li>\n	<li>Experience working in an Agile/Scrum development process.</li>\n	<li>Experience in writing clear, concise and comprehensive test plans and test cases.</li>\n</ol>\n','360000',1,'2020-12-22'),(6,97,20,'Sr. BDE',2,'BDE','Should have worked on Laravel, Core PHP, CakePHP, CodeIgnitor, WordPress etc.','2',6,'IT','Mohali','<ol>\n	<li>Create &amp; manage project plans.</li>\n	<li>Define project schedules, allocate resources, and monitor progress.</li>\n	<li>Align project objectives with company goals, and make sure the project team is clear on objectives.</li>\n	<li>Deliver and install technology solutions.</li>\n	<li>Help the project team with the design and development tasks.</li>\n	<li>Lead process of issue identification and resolution.</li>\n	<li>Manage risk tracking process.</li>\n	<li>Monitor and manage scope.</li>\n	<li>Manage all documentation.</li>\n	<li>Work on multiple projects simultaneously.</li>\n</ol>\n','5 LAC PER ANUM',1,'2020-12-23');
